/** Construct a plane with a specific vector, and D offset
 * from origin.
 *@param D is the D offset from the origin.
 */
public Plane(Vector v, double D) {
    super(v.x,v.y,v.z);
    this.D = D;
}

/** Construct a plane with a specific vector, and D offset
 * from origin.
 *@param D is the D offset from the origin.
 */
public Plane(final Vector v, final double D) {
    super(v.x,v.y,v.z);
    this.D = D;
}

